        public void PaymentReceipt()
        {
            string fetch = $@"<fetch version='1.0' output-format='xml-platform' mapping='logical' distinct='true'>
                  <entity name='salesorder'>
                    <attribute name='name' />
                    <attribute name='customerid' />
                    <attribute name='statecode' />
                    <attribute name='statuscode' />
                    <attribute name='totalamount' />
                    <attribute name='salesorderid' />
                    <attribute name='hil_sellingsource' />
                    <attribute name='hil_productdivision' />
                    <attribute name='hil_ordertype' />  
                    <order attribute='name' descending='false' />
                    <filter type='and'>
                      <filter type='or'>
                            <filter type='and'>
                                <condition attribute='hil_paymentstatus' operator='eq' value='3'/>
                                <condition attribute='hil_modeofpayment' operator='eq' value='3'/>
                            </filter>
                            <filter type='and'>
                                <condition attribute='hil_paymentstatus' operator='eq' value='2'/>
                                <condition attribute='hil_modeofpayment' operator='eq' value='1'/>
                            </filter>
                      </filter>
                      <condition attribute='statecode' operator='eq' value='0' />
                     <condition attribute='createdon' operator='on-or-after' value='2025-01-23' />
                    </filter>
                    <link-entity name='hil_mediagallery' from='hil_salesorder' to='salesorderid' link-type='outer' alias='ac' />
                    <filter type='and'>
                      <condition entityname='ac' attribute='hil_mediatype' operator='ne' value='{new Guid("df589095-4301-ef11-9f89-6045bdac6fcc")}' />
                    </filter>
                  </entity>
                </fetch>";

            EntityCollection pendingOrders = service.RetrieveMultiple(new FetchExpression(fetch));

            foreach (var order in pendingOrders.Entities)
            {
                string fetchXML = $@"<fetch version='1.0' output-format='xml-platform' mapping='logical' distinct='false'>
                                  <entity name='hil_mediagallery'>
                                    <attribute name='hil_mediagalleryid' />
                                    <attribute name='hil_name' />
                                    <attribute name='createdon' />
                                    <order attribute='hil_name' descending='false' />
                                    <filter type='and'>
                                      <condition attribute='hil_mediatype' operator='eq'  value='{{df589095-4301-ef11-9f89-6045bdac6fcc}}' />
                                      <condition attribute='hil_salesorder' operator='eq' value='{order.Id}' />
                                      <condition attribute='statecode' operator='eq' value='0' />
                                      <condition attribute='hil_url' operator='not-null' />
                                    </filter>
                                  </entity>
                                </fetch>";
                EntityCollection entMediagallery = service.RetrieveMultiple(new FetchExpression(fetchXML));
                if (entMediagallery.Entities.Count > 0)
                {
                    continue;
                }
                createReceiptforOrder(order);
            }
        }
        private void createReceiptforOrder(Entity salesOrder)
        {
            string AMCPlanName = "";
            string fetchXML = $@"<fetch version='1.0' output-format='xml-platform' mapping='logical' distinct='false'>
                      <entity name='salesorderdetail'>
                        <attribute name='productid' />
                        <attribute name='productdescription' />
                        <attribute name='priceperunit' />
                        <attribute name='quantity' />
                        <attribute name='extendedamount' />
                        <attribute name='salesorderdetailid' />
                        <order attribute='productid' descending='false' />
                        <filter type='and'>
                          <condition attribute='salesorderid' operator='eq' value='{salesOrder.Id}' />
                        </filter>
                      </entity>
                    </fetch>";

            EntityCollection entColl = service.RetrieveMultiple(new FetchExpression(fetchXML));
            if (entColl.Entities.Count > 0)
            {
                AMCPlanName = entColl.Entities[0].GetAttributeValue<EntityReference>("productid").Name;
            }

            Entity customer = service.Retrieve("contact", ((EntityReference)salesOrder.Attributes["customerid"]).Id, new ColumnSet(true));

            QueryExpression query = new QueryExpression("hil_paymentreceipt");
            query.ColumnSet = new ColumnSet(true);
            query.Criteria.AddCondition("hil_orderid", ConditionOperator.Equal, salesOrder.Id);
            query.Criteria.AddCondition("hil_paymentstatus", ConditionOperator.Equal, 4);
            query.AddOrder("createdon", OrderType.Descending);
            query.TopCount = 1;
            EntityCollection receiptsCollection = service.RetrieveMultiple(query);
            if (receiptsCollection.Entities.Count > 0)
            {
                string firstName = customer.Contains("firstname") ? customer.GetAttributeValue<string>("firstname") : "";
                string lastName = customer.Contains("lastname") ? customer.GetAttributeValue<string>("lastname") : "";
                AmcReceiptData data = new AmcReceiptData();
                data.ReceiptNumber = receiptsCollection.Entities[0].GetAttributeValue<string>("hil_transactionid");
                data.CustomerName = firstName + " " + lastName;
                data.ContactNumber = customer.GetAttributeValue<string>("mobilephone");
                data.Email = customer.Contains("emailaddress1") ? customer.GetAttributeValue<string>("emailaddress1") : "";
                data.CRMRefNo = salesOrder.GetAttributeValue<string>("name");
                DateTime receiptDate = receiptsCollection.Entities[0].GetAttributeValue<DateTime>("hil_receiptdate").AddMinutes(330);
                if (salesOrder.GetAttributeValue<EntityReference>("hil_sellingsource").Id == new Guid("608e899b-a8a3-ed11-aad1-6045bdad27a7"))//Havells-One Website
                {
                    data.PaymentMode = "Online";
                    data.Date = receiptDate.Date.ToString("dd-MM-yyyy");
                }
                else
                {
                    data.PaymentMode = receiptsCollection.Entities[0].GetAttributeValue<string>("hil_paymentmode");
                    data.Date = receiptDate.ToString("dd-MM-yyyy hh:mm tt");
                }
                data.Amount = receiptsCollection.Entities[0].Contains("hil_amount") ? receiptsCollection.Entities[0].GetAttributeValue<Money>("hil_amount").Value.ToString("F2") : "";
                data.TypeOfAMC = salesOrder.Contains("hil_productdivision") ? salesOrder.GetAttributeValue<EntityReference>("hil_productdivision").Name : "";
                data.AMCPlanName = AMCPlanName;
                data.AMCPlan = salesOrder.Contains("hil_ordertype") ? salesOrder.GetAttributeValue<EntityReference>("hil_ordertype").Name : "";

                string fileName = "PR_" + receiptsCollection.Entities[0].GetAttributeValue<string>("hil_transactionid")+".pdf";
                string blobURL = CreateAMCDocumentFile(data, fileName);
                UpdateOrder(blobURL, customer, salesOrder, receiptsCollection.Entities[0]);
            }
        }
        private string ToURLSlug(string s)
        {
            return Regex.Replace(s, @"[^a-z0-9]+", "-", RegexOptions.IgnoreCase)
                .Trim(new char[] { '-' })
                .ToLower();
        }
        private string Upload(string fileName, byte[] fileContent, string containerName)
        {
            Console.WriteLine("Upload to Blob Started");
            string _blobURI = string.Empty;
            try
            {
                //byte[] fileContent = Convert.FromBase64String(noteBody);
                string ConnectionSting = "DefaultEndpointsProtocol=https;AccountName=d365storagesa;AccountKey=6zw5Lx4X+zHrh+CAKLdgaWSqVZ1zC7AKugPkNEGevep6qhh1xRm5Q3DBWKGJ+DsWfCZk59BbLSJvja81DD4++w==;EndpointSuffix=core.windows.net";
                // create object of storage account
                CloudStorageAccount storageAccount = CloudStorageAccount.Parse(ConnectionSting);
                // create client of storage account
                CloudBlobClient client = storageAccount.CreateCloudBlobClient();
                // create the reference of your storage account
                CloudBlobContainer container = client.GetContainerReference(ToURLSlug(containerName));
                // check if the container exists or not in your account
                var isCreated = container.CreateIfNotExists();
                // set the permission to blob type
                container.SetPermissionsAsync(new BlobContainerPermissions
                { PublicAccess = BlobContainerPublicAccessType.Blob });
                // create the memory steam which will be uploaded
                using (MemoryStream memoryStream = new MemoryStream(fileContent))
                {
                    // set the memory stream position to starting
                    memoryStream.Position = 0;
                    // create the object of blob which will be created
                    // Test-log.txt is the name of the blob, pass your desired name
                    CloudBlockBlob blob = container.GetBlockBlobReference(fileName);
                    // get the mime type of the file
                    string mimeType = "application/unknown";
                    string ext = (fileName.Contains(".")) ?
                                System.IO.Path.GetExtension(fileName).ToLower() : "." + fileName;
                    Microsoft.Win32.RegistryKey regKey =
                                Microsoft.Win32.Registry.ClassesRoot.OpenSubKey(ext);
                    if (regKey != null && regKey.GetValue("Content Type") != null)
                        mimeType = regKey.GetValue("Content Type").ToString();
                    // set the memory stream position to zero again
                    // this is one of the important stage, If you miss this step, 
                    // your blob will be created but size will be 0 byte
                    memoryStream.ToArray();
                    memoryStream.Seek(0, SeekOrigin.Begin);
                    // set the mime type
                    blob.Properties.ContentType = mimeType;
                    // upload the stream to blob
                    blob.UploadFromStream(memoryStream);
                    _blobURI = blob.Uri.AbsoluteUri;
                }
            }
            catch (Exception ex)
            {
                throw new Exception("JobSheet.JobSheet.Upload: " + ex.Message);
            }
            Console.WriteLine("file uploaded");
            return _blobURI;
        }
        private string HtmltoPdf(string _fileName, string htmlBody)
        {
            string blobUrl = null;
            try
            {
                GlobalConfig gc = new GlobalConfig();
                gc.SetMargins(new System.Drawing.Printing.Margins(0, 0, 0, 0))
                    .SetDocumentTitle("Payment Receipt")
                    .SetPaperSize(PaperKind.A4);

                IPechkin pechkin = new SynchronizedPechkin(gc);
                ObjectConfig configuration = new ObjectConfig();
                configuration
                .SetPrintBackground(false)
                .SetAllowLocalContent(true);

                byte[] pdfContent = pechkin.Convert(configuration, htmlBody);
                Console.WriteLine("Document is Created and Uploading in Blob ");
                blobUrl = Upload(_fileName, pdfContent, "warrantydocs");
            }
            catch (Exception ex)
            {
                Console.WriteLine("error");
            }

            return blobUrl;
        }
        private string CreateAMCDocumentFile(AmcReceiptData data, string fileName)
        {
            string htmlBody = GetHTMLBody(data);

            string blobUrl = HtmltoPdf(fileName, htmlBody);
            return blobUrl;
        }
