        private void UpdateOrder(string fileURL, Entity customer, Entity salesOrder, Entity receipt)
        {
            #region Payment Receipt Check
            string fetch = $@"<fetch>
                          <entity name=""hil_mediagallery"">
                            <attribute name=""hil_mediatype"" />
                            <attribute name=""hil_salesorder"" />
                            <attribute name=""statecode"" />
                            <filter>
                              <condition attribute=""hil_salesorder"" operator=""eq"" value=""{salesOrder.Id}"" />
                              <condition attribute=""hil_mediatype"" operator=""eq"" value=""1c28cda4-cc69-ef11-a670-7c1e520f5a4e"" />  
                              <condition attribute=""statecode"" operator=""eq"" value=""0"" />
                            </filter>
                          </entity>
                        </fetch>";

            EntityCollection mgall = service.RetrieveMultiple(new FetchExpression(fetch));
            #endregion
            if (mgall.Entities.Count == 0)
            {
                Entity mediaGallary = new Entity("hil_mediagallery");
                mediaGallary["hil_name"] = "PaymentReceipt_" + receipt.GetAttributeValue<string>("hil_transactionid");
                mediaGallary["hil_mediatype"] = new EntityReference("hil_mediatype", new Guid("df589095-4301-ef11-9f89-6045bdac6fcc"));
                mediaGallary["hil_consumer"] = customer.ToEntityReference();
                mediaGallary["hil_salesorder"] = salesOrder.ToEntityReference();
                mediaGallary["hil_url"] = fileURL;
                service.Create(mediaGallary);
            }
        }
    }
